import React from "react";

const Landing = () => {
  return (
    <div className="Landing">
      <header className="Landing-header">
        <h1>Welcome to NotePaca</h1>
        <p>Your note-taking companion</p>
      </header>
    </div>
  );
};

export default Landing;
